using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UISearchControllerDelegate_Ref/index.html#//apple_ref/occ/intf/UISearchControllerDelegate	/// <summary>	/// This protocol defines delegate methods for UISearchController objects.	/// </summary>	[iOSVersion(8)]	public interface UISearchControllerDelegate	{		/// <summary>		/// Called when the search controller has been dismissed.		/// </summary>		/// <param name="searchController">The search controller to dismiss.</param>		[iOSVersion(8)]		[Export("didDismissSearchController")]		[Optional]		void DidDismissSearchController(UISearchController searchController);				/// <summary>		/// Called when the search controller has been presented.		/// </summary>		/// <param name="searchController">The search controller to present.</param>		[iOSVersion(8)]		[Export("didPresentSearchController")]		[Optional]		void DidPresentSearchController(UISearchController searchController);				/// <summary>		/// Presents the designated search controller.		/// </summary>		/// <param name="searchController">The search controller to be presented.</param>		[iOSVersion(8)]		[Export("presentSearchController")]		[Optional]		void PresentSearchController(UISearchController searchController);				/// <summary>		/// Called just before the search controller is dismissed.		/// </summary>		/// <param name="searchController">The search controller to dismiss.</param>		[iOSVersion(8)]		[Export("willDismissSearchController")]		[Optional]		void WillDismissSearchController(UISearchController searchController);				/// <summary>		/// Called just before the search controller is displayed.		/// </summary>		/// <param name="searchController">The search controller that is showing the view.</param>		[iOSVersion(8)]		[Export("willPresentSearchController")]		[Optional]		void WillPresentSearchController(UISearchController searchController);	}}